import { HStack, Button } from '@chakra-ui/react'
import React from 'react'
import { Link } from 'react-router-dom'
const Header = () => {
    return (
        <HStack
            p={'4'}
            shadow={'base'}
            bgColor={'blackAlpha.900'}
            position={'sticky'}
            top={'0'}
            left={'0'}
            zIndex={'overlay'}
            justifyContent={['space-between', 'flex-start']}
        >
            <Button _hover={[{ transform: 'scale(1)' }, { transform: 'scale(1.1)' }]} p={[0, 15]} fontSize={[15, 25]} variant={'unstyled'} color={'white'}>
                <Link to={'/'}>Home</Link>
            </Button>
            <Button _hover={[{ transform: 'scale(1)' }, { transform: 'scale(1.1)' }]} p={[0, 15]} fontSize={[15, 25]} variant={'unstyled'} color={'white'}>
                <Link to={'/exchanges'}>Exchanges</Link>
            </Button>
            <Button _hover={[{ transform: 'scale(1)' }, { transform: 'scale(1.1)' }]} p={[0, 15]} fontSize={[15, 25]} variant={'unstyled'} color={'white'} textTransform={'capitalize'}>
                <Link to={'/coins'} >coins</Link>
            </Button>
        </HStack>
    )
}

export default Header;
